components.nf-area-stack.description:
A component for grouping and stacking `nf-area` components in an `nf-graph`.

This component looks at the order of the `nf-area` components underneath it 
and uses the ydata of the next sibling `nf-area` component to determine the bottom 
of each `nf-area` components path to be drawn.

### Example

 		{{#nf-graph width=300 height=100}}
 			{{#nf-graph-content}}
 				{{#nf-area-stack}}
 					{{nf-area data=myData xprop="time" yprop="high"}}
 					{{nf-area data=myData xprop="time" yprop="med"}}
 					{{nf-area data=myData xprop="time" yprop="low"}}
 				{{/nf-area-stack}}
 			{{/nf-graph-content}}
 		{{/nf-graph}}

components.nf-graph.description:
A container component for building complex Cartesian graphs.

## Minimal example

     {{#nf-graph width=100 height=50}}
       {{#nf-graph-content}}
         {{nf-line data=lineData xprop="foo" yprop="bar"}}
       {{/nf-graph-content}}
     {{/nf-graph}}

The above will create a simple 100x50 graph, with no axes, and a single line
plotting the data it finds on each object in the array `lineData` at properties
`foo` and `bar` for x and y values respectively.

## More advanced example

     {{#nf-graph width=500 height=300}}
       {{#nf-x-axis height="50"}}
         <text>{{tick.value}}</text>
       {{/nf-x-axis}}

       {{#nf-y-axis width="120"}}
         <text>{{tick.value}}</text>
       {{/nf-y-axis}}

       {{#nf-graph-content}}
         {{nf-line data=lineData xprop="foo" yprop="bar"}}
       {{/nf-graph-content}}
     {{/nf-graph}}

The above example will create a 500x300 graph with both axes visible. The graph will not 
render either axis unless its component is present.

components.nf-table.description:
Composable table component with built-in sorting

### Basic Example

      {{#nf-table rows=myData}}

      	{{#nf-column sortField="foo"}}
      	  {{nf-header}}
      	  	Foo
      	  {{/nf-header}}
      	  {{#nf-cell}}
      			{{row.foo}}
      	  {{/nf-cell}}
      	{{/nf-column}}

      	{{#nf-column sortField="foo"}}
      	  {{nf-header}}
      	  	Bar
      	  {{/nf-header}}
      	  {{#nf-cell}}
      			{{row.bar}}
      	  {{/nf-cell}}
      	{{/nf-column}}

      {{/nf-table}}

The example above will create a sortable table from an array `myData` containing objects
with fields `foo` and `bar`.

### Grouped Example

If you wish to create a "grouped table", you simply need to group the data with the `groupBy`
property.

Additionally, you can add grouping rows with the `{{nf-table-group}}` component, which allows you
to define the columns for the group rows. If you do this, you will need to create an ArrayController
for the group that will carry with it any computed properties you might need, such as a sum or average
aggregated over the group.

			{{#nf-table rows=myData groupBy="baz"}}

				{{#nf-table-group itemController="my-group-controller"}}

					{{#nf-column}}
						{{#nf-cell colspan="2"}}
							Baz = {{group.groupValue}}
						{{/nf-cell}}
					{{/nf-column}}

				{{/nf-table-group}}

      	{{#nf-column sortBy="foo"}}
      	  {{nf-header}}
      	  	Foo
      	  {{/nf-header}}
      	  {{#nf-cell}}
      			{{row.foo}}
      	  {{/nf-cell}}
      	{{/nf-column}}

      	{{#nf-column sortBy="foo"}}
      	  {{nf-header}}
      	  	Bar
      	  {{/nf-header}}
      	  {{#nf-cell}}
      			{{row.bar}}
      	  {{/nf-cell}}
      	{{/nf-column}}

      {{/nf-table}}

### Styling

nf-table emits a `<table>` with a class of `nf-table` applied to it.

utils.parse-property-expression.description:
A function that will parse a path expression into a "getter" function that
can retrieve a value from that path off of any object when called.

### Example

      import parsePropertyExpr from 'utils/parse-property-expr';

      var test = { foo: { bar: ['apple', 'banana'] } };
      var getFooBar1 = parsePropertyExpr('foo.bar[1]');
      var result = getFooBar1(test);
      console.log(result); // "banana"

### Notes

Will return `undefined` if the nothing is at the end of the path, or the
path cannot be reached.

